-- insert app records for all user accounts and without and user preferences
SELECT ua.id, a.id, CURRENT_TIMESTAMP
FROM app_portfolio.user_account ua,
     app_portfolio.app a
WHERE ua.username LIKE 'Demo%'
AND   a.id >0;
-- insert user settings for app2
--Oracle does not like FETCH NEXT 500 ROWS ONLY on some SQL and returns ORA-00918: column ambiguously defined
-- insert random user account likes
-- order by random and set limit to 500
SELECT ua1.id "id1", ua2.id "id2",CURRENT_TIMESTAMP
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%'
FETCH NEXT 500 ROWS ONLY;
-- insert random user account view with user account, without user variables
-- order by random and set limit to 500
SELECT ua1.id, ua2.id,NULL,NULL,NULL,NULL,CURRENT_TIMESTAMP
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%';
-- insert random user account views anonymous, without user variables
-- order by random and set limit to 500
SELECT NULL, ua2.id,NULL,NULL,NULL,NULL,CURRENT_TIMESTAMP
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%';
-- insert random user account followers
-- order by random and set limit to 500
SELECT ua1.id, ua2.id id_follow,CURRENT_TIMESTAMP
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%'
FETCH NEXT 500 ROWS ONLY;
-- insert random user setting likes for app2
-- order by random and set limit to 500
SELECT ua1.id, us.id,CURRENT_TIMESTAMP
FROM   app_portfolio.user_account ua1,
	   app_portfolio.app2_user_setting us,
       app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND us.user_account_app_user_account_id = ua2.id
AND ua2.username like 'Demo%';
-- insert random user setting views for app2 without user variables
-- order by random and set limit to 500
